    {
        static void Main(string[] args)
        {
            const string CommandSimpleAttack = "1";
            const string CommandFireBall = "2";
            const string CommandExplosion = "3";
            const string CommandTreatment = "4";

            int bossHealth = 150;
            Random random = new Random();
