    sort(niza, niza + n);
    
    int L = 0, R = n - 1;
    while(L <= R) {
        int middle = (L + R) / 2;
        if(niza[middle] == x) {
            cout << "Ovoj broj postoi vo nizata" << endl;
            return 0;
        }
        if(niza[middle] < x) {
            L = middle + 1;
        }
        else {
            R = middle - 1;
        }
    }
